import '../styles/RentList.css'
import RentCard from './RentCard';
import { allRent } from '../data/logements.json'

function RentList() {
    let allRent = JSON.stringify(allRent);
    return (
        <div class="all-rent">
            {allRent.map(({ id, cover, title }) =>
            <div key={id}>
            <RentCard
                id={id}
                cover={cover}
                title={title}
            />
            </div>
            )}
        </div>
)}


export default RentList
